import { Grid } from "@mui/material";
import { TextField } from "@mui/material";
import { Divider } from "@mui/material";
import { Typography } from "@mui/material";
import React, { useRef } from "react";
import { useNavigate } from "react-router-dom";
import { signIn } from "../../Service/ApiService";
const SignInForm = () => {
  const idRef = useRef("");
  const pwRef = useRef("");
  let navigate = useNavigate();

  const formHandler = () => {
    const a = signIn(idRef.current.value, pwRef.current.value);
    a.then((r) => {
      if (r?.idToken) {
        alert("Successfully Sign In. \n 가입이 완료 되었습니다.");
        navigate("/login");
      }
    });
  };

  return (
    <section>
      <Typography variant="h6" color="white">
        Input Email and Password to sign in!!
      </Typography>
      <Typography variant="h6" color="white">
        이메일 과 패스워드를 입력해서 가입해 보세요!!
      </Typography>
      <Divider sx={{ backgroundColor: "white", marginTop: "10px" }} />
      <Grid container spacing={4} style={{ marginTop: "10px" }}>
        <Grid item xs={12} sm={3}>
          {}
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            color="primary"
            sx={{
              input: {
                borderRadius: "5px",
                border: "1px solid white",
                color: "white",
              },
            }}
            margin="dense"
            name="Id"
            label="ID "
            type="text"
            fullWidth
            inputRef={idRef}
          />
          <TextField
            margin="dense"
            required
            name="Id"
            sx={{
              input: {
                borderRadius: "5px",
                border: "1px solid white",
                color: "white",
              },
            }}
            label="Password"
            type="password"
            fullWidth
            inputRef={pwRef}
          />
          <button style={{ marginTop: "30px" }} onClick={formHandler}>
            Submit
          </button>
        </Grid>
      </Grid>
    </section>
  );
};

export default SignInForm;
